function LoggedIn() {

    return (
        <form class="login-form" >
            <div className="form-inner">
                <h1>Welcome to KeepItSafe</h1>
                <h2>What would you like to do?</h2>
                <div>
                    <button className = "dashboard-button">Add New</button>
                    <button className = "dashboard-button">View Saved</button>
                </div>
            </div>
        </form>
    );
};

export default LoggedIn;
